SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

USE `fcheck`;

SET NAMES utf8mb4;

DROP TABLE IF EXISTS `time_spent`;
CREATE TABLE `time_spent` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `route` varchar(128) COLLATE utf8mb4_czech_ci DEFAULT NULL COMMENT 'Podstránka',
  `time` int(11) NOT NULL COMMENT 'Strávený čas [ms]',
  `user` int(11) NOT NULL COMMENT 'Uživatel',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Konec měřeného úseku',
  PRIMARY KEY (`id`),
  KEY `user` (`user`),
  CONSTRAINT `time_spent_ibfk_1` FOREIGN KEY (`user`) REFERENCES `user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_czech_ci;


